        }else if (action === '-2') {
          setImageSrc4(stand)
        }
      }else if (did === '8') {
        if (action === '-3') {
          setImageSrc4(fall)
        }else if (action === '-2') {
          setImageSrc4(stand)
        }
      }else if (did === '9') {
        if (action === '-3') {
          setImageSrc4(fall)
