        const WebSocket = require('ws');
        const socket = new window.WebSocket('ws://localhost:8080');

        socket.onmessage = (event) => {
          setMessage(event.data);
          const arr1 = event.data.split(",")
          const did = arr1[1]
          const hr = arr1[3]
          const rp = arr1[5]
          const tp = arr1[4]
          const action = arr1[7]
          changeImageSrc(action)

          console.log('did: '+did)
          console.log('hr: '+hr)
          console.log('rp: '+rp)
          console.log('tp: '+tp)

          if (did === '1'){
            user1_hr=hr;
            user1_rp=rp;
            user1_tp=tp;
          }
          else if (did === '2'){
