                    <div id="tp"><FaTemperatureHigh/> : {user3_hr} </div>
                </Link>              
                </div>                  
                </div>
                </div>
                <div>
                <div className="row2">
                <div className="square">
                <Link to={"/Detail4"}>
                    <div id="data" className="click">#4</div><br/>
                    <img className="pic" src={imageSrc4} height="45px" alt="main"/>
